    font-size: 2.3rem;
    color: #fff;
    font-weight: 700;
    margin-bottom: 1rem;
}
.ranking-banner{
    position: relative;
    width: 100%;
    height: 50%;
    border-radius: 2px;
    display: flex;
    justify-content: center;
    align-items: center;


    &__box{
        position: relative;
        width: 100%;
        height: 100%;

        display: grid;
        grid-template-columns: 1fr repeat(12, minmax(14px, 4%)) 1fr; 
        grid-template-rows: 1fr repeat(19, minmax(10px, max-content)) 1fr;
        padding-top: 10px;

        &--bg{
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            padding: 5px;
        }
    }

    &__podio{
        position: relative;
        display: flex;
        justify-content: center;

        &--legend{
            position: absolute;
            top: -12px;
            width: 100%;
            font-family: 'Oswald Bold';
            font-size: 1rem;
            font-weight: 700;
            display: block;
            text-align: center;
        }

        &--star{
            width: 1rem;
        }
        &--character{
            width: 100%;
            height: 100%;
        }
        &--1{
            grid-column: 6 / 10;
            grid-row: 3 / 8;
        }
        &--2{
            grid-column: 2 / 6;
            grid-row: 5 / 9;
        }
        &--3{
            grid-column: 10 / 14;
            grid-row: 6 / 10;
        }
        &--img{
            position: relative;
            grid-column: 2 / 14;
            grid-row: 8 / 13;
            width: 100%;
            height: 100%;

        }
    }
    &__game-name{
        position: relative;
        grid-column: 1 / 15;
        grid-row: 12 / 17;
        width: 100%;
        max-width: 280px;
        height: 100%;
        margin: 0 auto;
    }
