        display: block;
        font-family: 'Oswald Bold';
        font-size: 4.4rem;
        letter-spacing: 3.5px;
        font-weight: 900;
        text-align: center;
        display: flex;
        justify-content: center;
        align-items: center;
        grid-column: 2 / 14;
        grid-row: 17 / 18;
        
        &--text{
            width: max-content;
            display: flex;
            align-items: center;
        }
        &--coin{
            transform: translateX(1rem);
            width: 2.5rem;
        }
